import React, { Component } from 'react';
import * as eng from '../../providers/engine';

import AccountsList from './list';
// import AccountsForm from './form';

export default class Academy extends Component {

    render() {
        const route = eng.getStorageJson('route');
        const type = route.type?route.type:'';
        switch(type){
            case 'form':
                return <AccountsForm />;
            default:
                return <AccountsList />;
        }
    }

}
